(window.webpackJsonp=window.webpackJsonp||[]).push([[101],{321:function(e){e.exports={data:{posts:{totalCount:85,pageInfo:{totalPages:9,currentPage:1,isFirst:!0,isLast:!1},edges:[{node:{title:"Chrome App Mode: webapps with elegance.",image:"/media/images/blog/portableshortcut.png",path:"/blog/2019/09/23/chrome-app-mode-webapps-with-elegance",excerpt:"<p>Browser-based apps have progressed a lot since the laggy and unresponsive experience that Google Docs was when it launched over a decade ago. Thanks to the power of HTML5, tasks from office suites to video editing now perform well enough that the browser can be a viable app platform for daily use.</p>\n",date:"2019-09-23T00:00:00.000Z",timeToRead:3}},{node:{title:"IT: Getting an old Windows machine running.",image:"/media/images/blog/nemesis.png",path:"/blog/2019/09/22/it-getting-an-old-windows-machine-running",excerpt:"<p>After throwing my friend Mark a surprise birthday party yesterday, I was given the task of getting a decade old Windows machine working and running Windows 10. I was given a Windows 7 Ultimate N key and this computer - a four hard drive behemoth - and set to work.</p>\n",date:"2019-09-22T00:00:00.000Z",timeToRead:4}},{node:{title:"Pearson Vue, Microsoft and Upskilling",image:"/media/images/blog/exam.png",path:"/blog/2019/09/05/pearson-vue-microsoft-and-upskilling",excerpt:'<p>On my quest to upskill, I decided to take exams online to gain some Microsoft certified qualifications. Starting at the beginning, I opted for <strong><a href="https://www.microsoft.com/en-us/learning/exam-ms-900.aspx" target="_blank" rel="nofollow noopener noreferrer">MS-900: Microsoft 365 Certified Fundamentals.</a></strong> I signed up to take the exam with the online provider <strong><a href="https://home.pearsonvue.com/" target="_blank" rel="nofollow noopener noreferrer">Pearson Vue</a></strong> at 9pm this Thursday night, and spent the last few days doing not much else other than studying. These exams are not free: $184 in local (NZ) currency. It might not seem like much, but money is tight for me right now.</p>\n',date:"2019-09-05T00:00:00.000Z",timeToRead:3}},{node:{title:"Information on Veon 4K TV's",image:"/media/images/blog/veonmaster.jpg",path:"/blog/2019/08/02/information-on-veon-4-k-tv-s",excerpt:'<p>Since restarting my blogging venture last year the post that I’ve received the most feedback on <a href="/blog/2018/11/28/veon-4-k-tv-review">was my budget Veon TV review.</a> I still get emails nearly a year later with people asking questions while they’re looking into buying one, or wanting help with different settings and features. There is very little information on these TV’s available online, <a href="https://www.thewarehouse.co.nz/" target="_blank" rel="nofollow noopener noreferrer">The Warehouse</a> doesn’t  provide any documentation and there are very few professional reviews available.</p>\n',date:"2019-08-02T00:00:00.000Z",timeToRead:8}},{node:{title:"It doesn't go away, it changes.",image:"/media/images/blog/railwayyard.jpg",path:"/blog/2019/07/24/it-doesn-t-go-away-it-changes",excerpt:'<h3 id="its-odd"><a href="#its-odd" aria-hidden="true"><span class="icon icon-link"></span></a>It’s odd.</h3>\n',date:"2019-07-24T00:00:00.000Z",timeToRead:2}},{node:{title:"Good Deals 2019",image:null,path:"/blog/2019/07/14/good-deals-2019",excerpt:"<p>This chain of events started off on one of those long nights I was spending at the care home, staying up all night next to my Dad during his final weeks. I couldn’t watch TV or play any kind of sound, nor did I want to put headphones on. I was there for Dad, and wanted to be alert. I sat there browsing my phone, mainly as a way to keep distracted from the gravity of his situation.</p>\n",date:"2019-07-14T00:00:00.000Z",timeToRead:4}},{node:{title:"Party like it's",image:"/media/images/blog/candle.jpg",path:"/blog/2019/07/07/party-like-it-s",excerpt:"<p>Right now it’s 2:30 am on Saturday morning and I just can’t sleep...</p>\n",date:"2019-07-07T00:00:00.000Z",timeToRead:2}},{node:{title:"Dying Changes Everything",image:"/media/images/blog/dadscar.jpg",path:"/blog/2019/06/30/dying-changes-everything",excerpt:'<h3 id="ebbs-and-flows"><a href="#ebbs-and-flows" aria-hidden="true"><span class="icon icon-link"></span></a>Ebbs and flows.</h3>\n',date:"2019-06-30T00:00:00.000Z",timeToRead:2}},{node:{title:"My Dad",image:"/media/images/blog/Dad.jpg",path:"/blog/2019/06/17/my-dad",excerpt:"<p>The past few weeks have been difficult.</p>\n",date:"2019-06-17T00:00:00.000Z",timeToRead:3}},{node:{title:"SciFi revivals: Stay Authentic or Redesign?",image:"/media/images/blog/DoctorWho-Tardis.png",path:"/blog/2019/05/10/sci-fi-revivals-stay-authentic-or-redesign",excerpt:"<p>Season two of Star Trek Discovery features the return of the premier starship Enterprise, but with a striking redesign that is causing some debate amongst fans. Narratively it is stated to be the same NCC-1701 ship from the original series, but many aspects of the new design are inconsistent with the original. The size, shape and basic layout reference the original but have been modified, putting it at odds with the recognizable ship’s form people have come to love from Star Trek: The Original Series.</p>\n",date:"2019-05-10T00:00:00.000Z",timeToRead:4}}]}}}}}]);